
# Labber driver for the QDevil QDAC voltage sources.
# Provided by QDevil 2019
[General settings]
name: QDevil QDAC With SW Ramping
version: 1.0
interface: serial
driver_path: QDevil_QDAC
# Remove the following line if you do not want Labber to read-in the QDAC state at start-up
#startup: Get config

[Model and options]
model_str_1: QDAC 1, 24 Channels
model_str_2: QDAC 1, 48 Channels

[VISA settings]
use_visa = True
baud_rate: 460800
parity: NONE
data_bits: 8
stop_bits: 1
always_read_after_write: False
term_char: LF
send_end_on_write: False
suppress_end_on_read: False

